import "./Btn.scss";

export const InputSwitch = () => {
  return (
    <label>
      <input
        role="switch"
        type="checkbox"
        checked={checked}
        onChange={onChange}
        disabled={disabled}
      />
    </label>
  );
};

export const InputRadio = () => {
  return (
    <label>
      <input name="" type="radio" />
    </label>
  );
};
